import About from "./components/About";
import Header from "./components/Header";
import Title from "./components/Title";

function App() {
  let name = "Adfar rashid"
  let age = 25
  let gravity = 9.8
  return (
    <>
      <div>
       <Header name="Adfar" age="25"/>
       <Header name="Supriya" age="25"/>
       <Header name="syed" age="25"/>
       <About name={name} age={age} gravity={gravity}/>
       <Title arr=""/>

      </div>
    </>
  );
}


export default App;
